import { Button, Container, Typography } from '@mui/material';
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

interface Workout {
  name: string;
  reps: number;
  sets: number;
}

interface WorkoutPlanProps {
  workoutImage: string;
  workouts: Workout[];
  startButtonColor: string;
}

const WorkoutPlan: React.FC<WorkoutPlanProps> = ({ workoutImage, workouts, startButtonColor }) => {
  const navigate = useNavigate();
  const [showWorkoutDetails, setShowWorkoutDetails] = useState(false);
  const [selectedWorkout, setSelectedWorkout] = useState<string | null>(null);

  const handleStartWorkout = (workoutName: string) => {
    setSelectedWorkout(workoutName);
    setShowWorkoutDetails(true);
  };

  const navigateBack = () => {
    setShowWorkoutDetails(false);
  };

  return (
    <Container maxWidth="md" sx={{ textAlign: 'center', mt: 3 }}>
      <img src={workoutImage} alt="Workout Preview" style={{ width: '100%', backgroundColor: 'white' }} />
      {workouts.map((workout) => (
        <div key={workout.name} style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px' }}>
          <Typography variant="body1" color="white">
            {workout.name}
          </Typography>
          <Typography variant="body1" color="white">
            {`${workout.reps} reps / ${workout.sets} sets`}
          </Typography>
          <Button
            variant="contained"
            size="large"
            style={{ backgroundColor: startButtonColor }}
            onClick={() => handleStartWorkout(workout.name)}
          >
            Start Workout
          </Button>
        </div>
      ))}

      {/* Render WorkoutDetails only when showWorkoutDetails is true */}
      {showWorkoutDetails && selectedWorkout && (
        <Container>
          {/* Pass any necessary props to WorkoutDetails */}
          <WorkoutDetails workoutName={selectedWorkout} />
          <Button variant="contained" size="large" color="primary" onClick={navigateBack}>
            Back to Workouts
          </Button>
        </Container>
      )}
    </Container>
  );
};

export default WorkoutPlan;
